  "biography": "Åby, Östergötland, 1st, son of landowner Axel Andersson and Anna Åström. Married in 1946 to Britt Sundin. Completed high school in Linköping in 1923, obtained a law degree from Uppsala University in 1929. Served as a court clerk in Linköping from 1929 to 1932, worked in the Svea Court of Appeal from 1932 to 1933, and established his own law firm in Linköping from 1933. Became a military prosecutor for the Life Grenadier Regiment, Svea Transport Corps, Östgöta Air Warfare Regiment, and Östergötland Air Force Wing from 1936. Also served as a board member for Skandinavbanken's Linköping branch, AB Stora Hotellet, the Linköping Theater Company, and others. Member of various social clubs and societies."
